import React, { Component } from 'react';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';
import WhatshotIcon from '@material-ui/icons/Whatshot';
import FitnessCenterIcon from '@material-ui/icons/FitnessCenter';
import VerticalAlignTopIcon from '@material-ui/icons/VerticalAlignTop';
import { withStyles } from "@material-ui/core/styles";

const styles = {
    root: {
      color: "green",
      "&$selected": {
        color: "red"
      }
    },
    selected: {}
  };

class Menu extends Component {

    render() { 

        //var menuStyle = {
           // position: 'fixed',
           // bottom: '1px',
           // width: '100%',
        //}

        return (
        <div >
   
        <BottomNavigation>
            <BottomNavigationAction label="PR Warmup" showLabel="True" value="PR Warmup" icon={<WhatshotIcon />} />
            <BottomNavigationAction label="Set Planner" showLabel="True" value= "Set Planner" icon={<FitnessCenterIcon />} />
            <BottomNavigationAction label="Reverse Maxes" showLabel="True" value= "Reverse Maxes" icon={<VerticalAlignTopIcon />} />
        </BottomNavigation>
            
        </div>
            );
    }
}
 
export default withStyles(styles) (Menu);
